    data: |
      SELECT * FROM tab2 (FORMAT parquet) WHERE + 15 NOT BETWEEN - - col2 + + 42 + - + 41 AND col0 * - - 51;
  - name: tab2

outputs:
  - name: q7383.out
    data: |
      46	51	23
      64	77	40
      75	67	58
